    return (
        <>
        <Helmet>
            <title>Search - YouTube</title>
        </Helmet>
            <Navbar />
            <div className="main">
                <Side />
                <Sidebar />
                <div className="main-scroll">
                    <div className="inner">
                        <h2>Search: </h2>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Search;
